import React from 'react';
import Footer from '../components/Footer';
import Slider from 'react-slick'; // Importando o componente do carrossel
import '../styles/About.css'; // Importando o CSS

const About = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div className="about-container">
      <h2 className="about-title">About Me</h2>
      <Slider {...settings}>
        <div>
          <p>Detalhe 1 sobre você</p>
        </div>
        <div>
          <p>Detalhe 2 sobre você</p>
        </div>
        <div>
          <p>Detalhe 3 sobre você</p>
        </div>
      </Slider>
      <Footer />
    </div>
  );
};

export default About;
